import Boutique from "./Boutique";
import { Link } from "react-router-dom";

const ShopEnlaces = () => {
  return (
    <div className="shop_enlaces">
      <ul>
        <li>
          <Link to="/">FEMME</Link>
        </li>
        <hr />
        <li>
          <Link to="./BoutiquePage">HOMME</Link>
        </li>
        <hr />
        <li>
          <Link to="./LaCollection">WETSUITS</Link>
        </li>
        <hr />
        <li>
          <Link to="./Histoire">SHORTYS</Link>
        </li>
        <hr />
        <li>
          <Link to="./Contact">TOPS</Link>
        </li>
      </ul>
    </div>
  );
};

export default ShopEnlaces;
